import { InputAdornment, TextField } from "@mui/material"
import React, { ChangeEvent } from "react"


interface props {
  type: string
  label: string
  style?: any

  name: string
  variant?: "outlined" | "standard" | "filled"
  
}

export default function Input({
  type,
  label,
  style,
  
  name,
  variant,
  
}: props) {
  
  return (
    <>
      <TextField
        type={type}
        label={label}
        name={name}
        sx={{ ...style }}
        variant={variant}
        size="small"

      
        
        
      />
              <InputAdornment position="end">kg</InputAdornment>
    </>
  )
}
